import React, { useEffect, useState } from "react";

function App() {
  const [user, setUser] = useState([])

  useEffect(() => {
    fetch("/api")
      .then((res) => {
        return res.json();
      })
      .then((data) => {
        setUser(data.employees);
      });
  }, []);

  return (
    <>
      {
        user.map((value, index) => {
          return (
            <>
              <h1>
                Name : {value.name}
              </h1>
              ]<h1></h1>
            </>
          )
        })
      }
    </>
  )
}

export default App;
